import React from "react";
import ReactApexChart from "react-apexcharts";

function Bargraph({ graphType }) {
  const data = {
    xaxis: {
      categories: [1991, 1992, 1993, 1994, 1995, 1996, 1997, 1998, 1999],
    },
  };

  const series = [
    {
      data: [
        {
          x: "category A",
          y: 10,
        },
        {
          x: "category B",
          y: 18,
        },
        {
          x: "category C",
          y: 13,
        },
        {
          x: "category D",
          y: 15,
        },
        {
          x: "category E",
          y: 20,
        },
        {
          x: "category F",
          y: 23,
        },
        {
          x: "category G",
          y: 25,
        },
        {
          x: "category H",
          y: 35,
        },
        {
          x: "category I",
          y: 50,
        },
      ],
    },
  ];


  const chartOption = {
    options: {
      chart: {
        width: 500,
        height: 100,
        type: graphType,
      },
    },
  };

  return (
    <div style={{ width: "500px", height: "100px" }}>
      <ReactApexChart
        options={chartOption.options}
        series={series}
        type={graphType}
      />
    </div>
  );
}

export default Bargraph;
